import react from "react";

function Table({ data = []})
{
    return(
        <>
            <div>
                <table>
                    <thead>
                        <tr>
                            <th>Id</th>
                            <th>Name</th>
                            <th>Icon</th>
                            <th>Text</th>
                        </tr>
                    </thead>
                    <tbody>
                        {data.length > 0 ? (
                        data.map((item, index) => (
                        <tr key={index}>
                            <td>{item.name}</td>
                            <td>{item.url}</td>
                            <td>{item.text}</td>
                        </tr>
                        ))
                        ) : (
                        <tr>
                            <td colSpan="3" style={{ textAlign: "center" }}>Brak danych</td>
                        </tr>
                        )}
                    </tbody>
                </table>
            </div>
        </>
    )
}

export default Table;
